<div class="box-body">
    <ol style="text-align:justify;">
        <li>Pada halaman CSI terdapat tombol Update yang berfungsi untuk melakukan sinkronisasi CSI dengan verification tools, tujuannya agar data CSI yang baru dibuat muncul pada verification tools.</li>
        <p style="text-align:justify;text-indent:40px;">Administrator dapat melakukan sinkronisasi CSI dengan menekan tombol Update.</p>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Setelah itu Administrator akan masuk ke halaman Update.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Administrator dapat memilih Version aplikasi yang akan di sinkronisasi ke verification tools.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Setelah sudah memilih Version, Administrator dapat menekan tombol submit untuk menjalankan proses.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Setelah menekan tombol Submit, maka akan menampilkan notifikasi, dan silahkan untuk memilih Yes untuk melanjutkan proses Update.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Setelah menekan tombol Yes maka akan ada proses yg berlangsung.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Jika proses sinkronisasi telah berhasil maka akan kembali kehalaman CSI.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
    </ol>
</div>
